package springweb.vo;

import java.util.Date;

public class Members {
	private String mId;
	private String mPass;
	private String mName;
	private String mAuth;
	private String mProType;
	private int mPhone;
	private String mBirth;
	private String mMail;
	private String mNick;
	private String mGender;
	private String mProfile;
	private String mIntroduce;
	private String mJoinDate;
	public Members() {
		super();
		// TODO Auto-generated constructor stub
	}
	public Members(String mId, String mPass, String mName, String mAuth, String mProType, int mPhone, String mBirth,
			String mMail, String mNick, String mGender, String mProfile, String mIntroduce, String mJoinDate) {
		super();
		this.mId = mId;
		this.mPass = mPass;
		this.mName = mName;
		this.mAuth = mAuth;
		this.mProType = mProType;
		this.mPhone = mPhone;
		this.mBirth = mBirth;
		this.mMail = mMail;
		this.mNick = mNick;
		this.mGender = mGender;
		this.mProfile = mProfile;
		this.mIntroduce = mIntroduce;
		this.mJoinDate = mJoinDate;
	}
	public String getmId() {
		return mId;
	}
	public void setmId(String mId) {
		this.mId = mId;
	}
	public String getmPass() {
		return mPass;
	}
	public void setmPass(String mPass) {
		this.mPass = mPass;
	}
	public String getmName() {
		return mName;
	}
	public void setmName(String mName) {
		this.mName = mName;
	}
	public String getmAuth() {
		return mAuth;
	}
	public void setmAuth(String mAuth) {
		this.mAuth = mAuth;
	}
	public String getmProType() {
		return mProType;
	}
	public void setmProType(String mProType) {
		this.mProType = mProType;
	}
	public int getmPhone() {
		return mPhone;
	}
	public void setmPhone(int mPhone) {
		this.mPhone = mPhone;
	}
	public String getmBirth() {
		return mBirth;
	}
	public void setmBirth(String mBirth) {
		this.mBirth = mBirth;
	}
	public String getmMail() {
		return mMail;
	}
	public void setmMail(String mMail) {
		this.mMail = mMail;
	}
	public String getmNick() {
		return mNick;
	}
	public void setmNick(String mNick) {
		this.mNick = mNick;
	}
	public String getmGender() {
		return mGender;
	}
	public void setmGender(String mGender) {
		this.mGender = mGender;
	}
	public String getmProfile() {
		return mProfile;
	}
	public void setmProfile(String mProfile) {
		this.mProfile = mProfile;
	}
	public String getmIntroduce() {
		return mIntroduce;
	}
	public void setmIntroduce(String mIntroduce) {
		this.mIntroduce = mIntroduce;
	}
	public String getmJoinDate() {
		return mJoinDate;
	}
	public void setmJoinDate(String mJoinDate) {
		this.mJoinDate = mJoinDate;
	}
	
}
	